import React from 'react';
import './App.css';

function App() {
    return (
        <div className="App">
            <div className="navigation">
                <ul>
                    <h1>Projects:</h1>
                    <li>eaturveg</li>
                    <li>Spotify Recently Added</li>
                    <li>Filmotography</li>
                </ul>
            </div>
            <div className="content">
                <a href="https://iguannalin.github.io/eaturveg/">View Project</a>
                <a href="https://iguannalin.github.io/spotify-recently-added/">View Project</a>
                <a href="https://annaylin.com/filmotography">View Project</a>
            </div>
        </div>
    );
}

export default App;
